import React from 'react';
import {NavLink} from 'react-router-dom'

import '../css/Nav.css'

const Nav = () => {
    return (
        <div>
            <nav className="navegacion">
                <NavLink to={'/nosotros'}> Nosotros </NavLink>
                <NavLink to={'/productos'}> Productos </NavLink>
                <NavLink to={'/contacto'}> Contacto </NavLink>
            </nav>
        </div>
    );
};

export default Nav;
